function Add(a, b) {
  return a + b;
}

function Sub(a, b) {
  return a - b;
}

function Mul(a, b) {
  return a * b;
}
function Mod(a, b) {
    return a % b;
}
function Divide(a, b) {
    return a / b;
}

export { Add };
